public class Q006 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		
		//출력값 예측
		System.out.println(10<3);//false
		System.out.println(10>=3);//true
		System.out.println(10<=3);//false
		System.out.println(10==3);//false
		System.out.println(10!=3);//true
		
		
	}

}
